import "./homepage.css";
import "../Logo/logo.js";
import LogoNuKenzie from "../Logo/logo.js";

function HomePage() {
  return (
    <main className="home-page">
      <header className="hp-header">
        <div className="hp-container-header">
          <LogoNuKenzie />
          <button></button>
        </div>
      </header>
      <form></form>
    </main>
  );
}
export default HomePage;
